import React from "react";
import '../App.css';






class DETAIL extends React.Component {

    componentDidMount() {
        this.detail_product()
    }

    detail_product() {


        var temp = window.location.search
        var text = temp.split("=");
        text = text[1];
        if (text == "") {
            console.log(text);
        }

        fetch("http://localhost:3030/detail/" + text, {
            method: "GET",
            headers: {
                "content-type": "application/json",
                accept: "application/json",
            },
        })
            .then((response) => response.json())
            .then((data) => {
                console.log(data);
            })
            .catch((err) => {
                console.log(err);
            });
    }



    render() {
        return (
            <>
                <section>

                    <div class="parallax" id="searchh">
                        <div class="card-deck"style={{ "padding-top": "33%", postion: "relative" }}></div>
                    </div>
                </section>
            </>
        );
    }
}

export default DETAIL;
